import React from "react";
import { Link } from "react-router-dom";
import "./NavBar.css";

export default function NavBar() {
  return (
    <nav>
      <Link to="/">
        <h2>Ilham Shop</h2>
      </Link>
      <ul>
        <Link to="/Connexion" className="links">
          <button className="boutons" type="button" value="Connexion" />
        </Link>
        <Link to="Inscription" className="links">
          <button className="boutons" type="button" value="Inscription" />
        </Link>
      </ul>
    </nav>
  );
}
